import React, { Component } from "react";
import Slider from "react-slick";
import image1 from '../assets/background-images/background-img.png';

export default class CertificationSlider extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1
    };
    return (
      <div>
        <Slider {...settings}>
          <div>
            <img src={image1} alt="images" width="100%"/>
          </div>
          <div>
          <img src={image1} alt="images" width="100%"/>
          </div>
          <div>
          <img src={image1} alt="images" width="100%"/>
          </div>
          <div>
            <h3>4</h3>
          </div>
          <div>
            <h3>5</h3>
          </div>
          <div>
            <h3>6</h3>
          </div>
        </Slider>
      </div>
    );
  }
}
